  var suffix = b[&quot;cp.utag_main_profile&quot;] = b[&quot;tealium_account&quot;] + &quot;_&quot; + b[&quot;tealium_profile&quot;];
  // claim the utag_main cookie for this profile
  utag.loader.SC(&quot;utag_main&quot;, {
    &quot;profile&quot;: b[&quot;cp.utag_main_profile&quot;],
  });
  util.writeCookie(&quot;utmain_&quot; + suffix, util.readCookie(&quot;utag_main&quot;), null, utag_data[&quot;cookie_path&quot;]);
}());

